import React from 'react'
import styled, { css } from 'styled-components'

export default function Button({ text, func }) {
    return (
        <div>
            <Yolo onClick={func}>{text}
            </Yolo>
        </div>
    )
}

const Yolo = styled.button`
   width: 100px;
   height: 50px;
   border-radius: 3px;
   background: red;
   color: white;

   ${props =>
    props.blue &&
    css`
     background: blue;
    `}; 
`
